import React from 'react';
import {Header, Icon } from 'semantic-ui-react';
import Vikings from '../Video/Vikings.mp4';
import Got from '../Video/got.mp4';


const HeaderPart = () => {
    return (
        <React.Fragment>
            <Header as='h2' icon textAlign='center'>
                <video autoPlay loop muted
                style={{
                    position: "absolute",
                    width : "100%",
                    objectFit :"cover",
                    transform : "translate(-50%,-10%)"
                    //zIndex: "-1"
                }}
                >
                    <source src={Vikings} type="video/mp4"/>
                </video>
               
            </Header>
        </React.Fragment>
    )
}

<React.Fragment>
<Segment placeholder>
    <video
        autoPlay
        loop
        muted
        style={{
             position: "absolute",
             width:"100%",
             top: "0%",
             left:"50%",
             height: "100%",
             objectFit: "cover",
            transform: "translate(-50%,-10%)"
        }}
    >
        <source src={Vikings} type="video/mp4" />
    </video>
</Segment>
<div>dsfsdfsdfsd</div>
</React.Fragment>

export default HeaderPart;
